import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import FilteredList from './FilteredList';
import Dropdown from 'react-bootstrap/Dropdown';
import Checkbox from '@mui/material/Checkbox';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';


export default function NavBar(props) {

  return (
    <div>
      <div>
        <Dropdown >
          <Dropdown.Toggle variant="success" id="dropdown-basic">
            Sort by
          </Dropdown.Toggle>

          <Dropdown.Menu >
            <Dropdown.Item onClick={() => {props.selectSortStyle("lth")}} eventKey="lth">Price: low to high</Dropdown.Item>
            <Dropdown.Item onClick={() => {props.selectSortStyle("htl")}} eventKey="htl">Price: high to low</Dropdown.Item>
          </Dropdown.Menu>
        </Dropdown>

        <FormControl>
          <InputLabel id="demo-simple-select-label">Age</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={props.type}
            label="Age"
            onChange={selectFilterType}
          >
            <MenuItem value= "lth" eventKey="lth">Price: low to high</MenuItem>
            <MenuItem eventKey="htl">Price: high to low</MenuItem>
            {/* <MenuItem value={30}>Thirty</MenuItem> */}
          </Select>
        </FormControl>
      </div>
      <FormControlLabel control={
          <Checkbox 
              onChange={(event) =>
                selectFilterType(event)
              }
              defaultChecked />
        } label="All" />
      <FormControlLabel control={
          <Checkbox 
              onChange={(event) =>
                selectFilterType(event)
              }
              defaultChecked />
        } label="Filter A" />
      <FormControlLabel control={
          <Checkbox 
              onChange={(event) =>
                selectFilterType(event)
              }
              defaultChecked />
        } label="Filter B" />

        {/* <Nav onSelect={props.selectFilterType}>
          <Nav.Item>Filter:</Nav.Item>
          <Nav.Item><Nav.Link eventKey="All">All</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link eventKey="5">Over $5</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link eventKey="5">Under</Nav.Link></Nav.Item>
        </Nav> */}
    </div>
  )
}

//sets the state to the selected type, function passed to the onSelect event handler of HTML buttons
function selectFilterType (typetype) {
  console.log(typetype)
}
